import React, { useState, useEffect } from 'react';
import './Button.css';


function Button(type, design) {
    const [button_logo, setMessage] = useState('');
   
    useEffect(() => 
    {      console.log(type);
        const url=`http://localhost:5000/${type.type}`;
        fetch(url).then(response => {
            const data = response.json()
            console.log(response);
            return data
        }).then(data => setMessage(data.message));
    }, [type]
    );
    // type is the type of button, design is the design class
    // type can be 'submit', 'button', etc.

    return (
        <div>
            <button className={design} >{button_logo}</button>
        </div>
    );
}


export default Button;
